description:
Paul Thomas re-imagines adult cinema's greatest masterpiece in a brand new Devil In Miss Jones that AVN is heralding as a milestone! In it, Savanna (Miss Jones) is a virgin suicide who begs Jenna (The Devil) to grant her just a little more time on earth before her descent into hell. New Devil In Miss Jones DVD video Jenna obliges... but only if Miss Jones totally and completely surrenders herself to the sins of the flesh! The 3-disk set also includes a full-length copy of the original classic movie!

